import React from "react";

const Forklift3D = () => {
  return (
    <div>
      <h1>3D Linde Forklift</h1>

      <div
        className="sketchfab-embed-wrapper"
        style={{ width: "640px", height: "480px" }}
      >
        <iframe
          title="Forklift Linde by Bruder Toy"
          frameBorder="0"
          allow="autoplay; fullscreen; xr-spatial-tracking"
          allowFullScreen
          mozAllowFullScreen="true"
          webkitAllowFullScreen="true"
          src="https://sketchfab.com/models/e283a5f6ec8046ffafb72368f625eb4f/embed"
          style={{ width: "100%", height: "100%" }}
        />
      </div>

      <p
        style={{
          fontSize: "13px",
          fontWeight: "normal",
          margin: "5px",
          color: "#4A4A4A",
        }}
      >
        <a
          href="https://sketchfab.com/3d-models/forklift-linde-by-bruder-toy-e283a5f6ec8046ffafb72368f625eb4f"
          target="_blank"
          rel="nofollow"
          style={{ fontWeight: "bold", color: "#1CAAD9" }}
        >
          Forklift Linde by Bruder Toy
        </a>{" "}
        by{" "}
        <a
          href="https://sketchfab.com/4visualization"
          target="_blank"
          rel="nofollow"
          style={{ fontWeight: "bold", color: "#1CAAD9" }}
        >
          4visualization
        </a>{" "}
        on{" "}
        <a
          href="https://sketchfab.com"
          target="_blank"
          rel="nofollow"
          style={{ fontWeight: "bold", color: "#1CAAD9" }}
        >
          Sketchfab
        </a>
      </p>
    </div>
  );
};

export default Forklift3D;
